import React from 'react';

const Listings = () => {
  const cars = [
    {
      name: 'Ferrari 812 Competizione',
      image: '/Image/ferrari-812-competizione.jpg',
      description: 'A V12-powered masterpiece with outstanding performance and design.',
    },
    {
      name: 'Porsche 918 Spyder',
      image: '/Image/Porsche-918.jpg',
      description: 'A hybrid hypercar that blends performance with cutting-edge technology.',
    },
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-center mb-6">Browse Car Listings</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {cars.map((car, index) => (
          <div key={index} className="bg-white rounded-xl shadow-lg p-4">
            <img
              src={car.image}
              alt={car.name}
              className="w-full h-64 object-cover rounded-lg mb-4"
            />
            <h2 className="text-xl font-semibold mb-2">{car.name}</h2>
            <p className="text-gray-700">{car.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Listings;
